          </tr>
        </thead>
        <tbody>
          {data && data.results && (
            <>
              {data.results.data.phase1.map((item, index) => (
                <tr key={index}>
                  <td>{item.ip}</td>
                  <td>{item.name}</td>
                  <td>{item.phase}</td>
                  <td>{item.status}</td>
                </tr>
              ))}


              {/* {data.results.data.phase2.map((item, index) => (
